import React from "react";
import { footer } from "../../data/Data";
import "./footer.css";
import RelatedMapIcon from "@rsuite/icons/RelatedMap";
import FacebookOfficialIcon from "@rsuite/icons/legacy/FacebookOfficial";
import GooglePlusCircleIcon from "@rsuite/icons/legacy/GooglePlusCircle";
import TwitterIcon from "@rsuite/icons/legacy/Twitter";
import LinkedinIcon from "@rsuite/icons/legacy/Linkedin";

const Footer = () => {
  return (
    <>
      <footer>
        <div className="container ">
          <div className="box aa ">
            <div className="logo justify-content-center">
              <div>
                <RelatedMapIcon style={{ fontSize: "4rem" }} color="#27ae60" />
                <h2 className="had1">
                  <i>ABFA</i>
                </h2>
              </div>
              {/* <img src='../images/logo-light.png' alt='' /> */}
              <h2>Do You Need Help With Anything?</h2>
              <p>
                Receive updates, hot deals, tutorials, discounts sent straignt
                in your inbox every month
              </p>

              <span>
                {" "}
                <a href="https://www.facebook.com/">
                  <FacebookOfficialIcon
                    style={{ fontSize: "2rem" }}
                    color="#27ae60"
                  />{" "}
                </a>
              </span>

              <span>
                {" "}
                <a href="https://www.facebook.com/">
                  <GooglePlusCircleIcon
                    style={{ fontSize: "2rem" }}
                    color="#27ae60"
                  />{"  "}
                </a>
              </span>

              <span>
                {" "}
                <a href="https://www.facebook.com/">
                  <TwitterIcon style={{ fontSize: "2rem" }} color="#27ae60" />{"  "}
                </a>
              </span>

              <span>
                {" "}
                <a href="https://www.facebook.com/">
                  <LinkedinIcon style={{ fontSize: "2rem" }} color="#27ae60" />{"  "}
                </a>
              </span>

              {/* <div className="input flex">
                <input type="text" placeholder="Email Address" />
                <button>Subscribe</button>
              </div> */}
            </div>
          </div>

          {/* {footer.map((val) => (
            <div className="box">
              <h3>{val.title}</h3>
              <ul>
                {val.text.map((items) => (
                  <li> {items.list} </li>
                ))}
              </ul>
            </div>
          ))} */}
        </div>
      </footer>
      <div className="legal">
        <span>© 2022 ABFA Marketing.</span>
      </div>
    </>
  );
};

export default Footer;
